import App from "./App";

export default function Main() {

    return (
        <section className="main">
            <h1>GIFWORLD</h1>
            <p>Eexplore nonasodnasdosandosndodsj</p>
            <Link to='/home'><button>GO</button></Link>
            <Route component={App} path='/home'></Route>
        </section>
    )
}
